package cls_java;
import java.util.*;

public class Carg {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int var1 = Integer.parseInt("21");
		float var2 = Float.parseFloat("13.2");
		double var3 = Double.parseDouble("5.2");
		byte var4 = Byte.parseByte("2");
		boolean var5 = Boolean.parseBoolean("false");
		long var6 = Long.parseLong("3423");
		short var7 = Short.parseShort("2");
		char var8 = "hello".charAt(0);
		System.out.println(var1);
		System.out.println(var2);
		System.out.println(var3);
		System.out.println(var4);
		System.out.println(var5);
		System.out.println(var6);
		System.out.println(var7);
		System.out.println(var8);
	}

}
